window.bookSummaryJSON = "<p><b><i>Captiva</i></b><b> by Randy Wayne White is now available for the first time in audio!</b></p> <p>\"We'll drop anything we're doing to read a new Randy White novel and be glad we did.\" (<i>Denver Post</i>)</p> <p>Randy Wayne White is acclaimed as \"wildly inventive\" (<i>The San Diego Union-Tribune</i>), \"a wonderful writer\" (Paul Theroux), \"a fine storyteller\" (Peter Matthiessen), and \"the rightful heir to John D. MacDonald\" (<i>The Tampa Tribune-Times</i>). In his fourth Doc Ford novel<i>,</i> he delivers a wicked thriller that sends government agent turned marine biologist Doc Ford into dangerous new waters as a Florida fishing dispute escalates into a deadly war that reaches across the ocean...</p>"; 
